"use strict";(self.webpackChunkjava_note_vuepress2=self.webpackChunkjava_note_vuepress2||[]).push([[4183],{17885:(n,e,a)=>{a.r(e),a.d(e,{data:()=>s});const s={key:"v-74479cac",path:"/maven/003-%E7%A4%BA%E4%BE%8B.html",title:"示例：创建 maven 项目",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],filePathRelative:"maven/003-示例.md",git:{updatedTime:1629711344e3,contributors:[{name:"hemiao",email:"hemiao3000@126.com",commits:1}]}}},45642:(n,e,a)=>{a.r(e),a.d(e,{default:()=>r});const s=(0,a(66252).uE)('<h1 id="示例-创建-maven-项目" tabindex="-1"><a class="header-anchor" href="#示例-创建-maven-项目" aria-hidden="true">#</a> 示例：创建 maven 项目</h1><p>通过骨架（archetype）创建 maven 工程</p><p>第一步：选择 new → maven → Maven Project</p><p>第二步：<strong><code>New Maven Project</code></strong> 窗口不作任何设置，直接 <strong>Next</strong> 。</p><p>第三步：选择 maven 的工程骨架，这里我们选择 <strong>quickstart</strong> ，点击 <strong>Next</strong> 。</p><p>第四步：输入 <em>GroupId</em> 、<em>ArtifactId</em> 、<em>Version</em> 、<em>Package</em> 信息点击 finish 完成。</p><p>其项目目录结构如下：</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>my-app\n│── pom.xml\n└── src\n    ├── main\n    │   └── java\n    │       └── xxx\n    │           └── yyy\n    │               └── zzz\n    │                   └── App.java\n    └── test\n        └── java\n            └── xxx\n                └── yyy\n                    └── zzz\n                        └── AppTest.java\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br><span class="line-number">13</span><br><span class="line-number">14</span><br><span class="line-number">15</span><br></div></div><p>注意，maven 项目有『<strong>固定的目录结构，与开发工具无关</strong>』。无论使用 Eclipse 还是 Intellij IDEA 都是如上的目录结构。</p>',9),r={render:function(n,e){return s}}}}]);